CREATE TABLE indiewise_db.users
(
    id char(36) PRIMARY KEY NOT NULL,
    firstName varchar(255),
    lastName varchar(255),
    fullName varchar(255),
    email varchar(255),
    bcryptPassword varchar(255),
    gender varchar(255),
    bio text,
    dob datetime,
    avatar varchar(2048) DEFAULT 'http://getindiewise.com/alpha/assets/img/default_avatar.jpg',
    username varchar(255),
    website varchar(255),
    urlFacebook varchar(255),
    urlTwitter varchar(255),
    urlGoogle varchar(255),
    country char(36),
    createdAt datetime,
    url_id varchar(255),
    coverPhoto varchar(255),
    CONSTRAINT country_country_bkname_users FOREIGN KEY (country) REFERENCES Country (id) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE INDEX country_country_bkname_users ON indiewise_db.users (country);
CREATE UNIQUE INDEX users_id_unique ON indiewise_db.users (id);
